import React from 'react';
import axios from 'axios';
import '../css/game.css'

class History extends React.Component{
    constructor(props) {
        super(props);
        this.state = {
            user_name: this.props.user_name,
            data_history: '',
        };
        // console.log(this.state)
    }


    componentDidMount(){
        this.get_data();
    };

    async get_data(){
        const data = await axios.post(`http://localhost:5000/dataFormGame/history`,{user_name:this.props.user_name});
        this.setState({data_history: data});
        console.log(data.data);
    }

    tabel_creat(){
        let tabel = '';
        for (let i =0; i < this.state.data_history.length;i++){
           tabel +=
                <tr>
                    <th scope="row">[i]</th>
                    <td>{this.state.history_games.created_on}</td>
                    <td>{this.state.history_games.min_number}</td>
                    <td>{this.state.history_games.max_number}</td>
                    <td>{this.state.history_games.user_number}</td>
                    <td>{this.state.history_games.computer_guess}</td>

                </tr>

        }

        return tabel
    }



    render() {
        console.log(this.state);
        return(
            <div>
                <table className="table table-dark">
                    <thead>
                    <tr>
                        <th scope="col">#</th>
                        <th scope="col">date</th>
                        <th scope="col">min_number</th>
                        <th scope="col">max_number</th>
                        <th scope="col">your number</th>
                        <th scope="col">computer guess</th>
                    </tr>
                    </thead>


                    <tbody>
                    {this.state.history_games != '' ?
                        this.tabel_creat()
                        :
                        null
                    }

                    </tbody>
                </table>
            </div>
        )
    }
}
export default History;
